import { Container, Row, Col } from 'react-bootstrap';
import { useEffect, useState } from 'react';

import './MainSection.css';
import CustomerCard from '../CustomerCard';

const MainSection = () => {

  const [customers, setCustomers] = useState([]);

  useEffect(() => {
    getCustomers();





  }, []);


  function getCustomers() {
    fetch('http://130.225.39.66:8080/test/get')
      .then((response) => response.json())
      .then((data) => {
        console.log(data);
        setCustomers(data);
      });
  }

  function createCustomer() {
    fetch('http://130.225.39.66:8080/test?id=12&customer=6969&type=1&address=hejvej')
      .then((response) => response.json())
      .then((json) => setCustomers(json));

      console.log(customers);
  }







  return (
    <>
      <Row className='mainsection mx-5 my-5'>
        <Col>
          <h1 className='px-3'>Customers</h1>
          <div className='divider'/>
          <div className='blackbar'>
            <input type="text" className="inputField" id="inputCustomer" placeholder="Search in customers"/>
            <select className="inputField" id="inputFilter" placeholder='Filter by'>
              <option>Name</option>
              <option>Age</option>
              <option>Gender</option>
            </select>
          </div>
          <p>{customers}</p>
          <div className="displaycustomers">
            <CustomerCard
              name='Benjamin Franklin'
              type="Person"
              address='Benjavej 24'
              city="Copenhagen"
            />
          </div>
          <div className='test'>
          </div>
        </Col>
      </Row>
    </>
  );
}

export default MainSection;
